import React from "react";
import { IonPage, IonHeader, IonToolbar, IonTitle } from "@ionic/react";

const News = () => {
  return (
    <IonPage>
      <IonHeader>
        <IonToolbar>
          <IonTitle>News</IonTitle>
        </IonToolbar>
      </IonHeader>
    </IonPage>
  );
};

export default News;
